import './App.css';
import { Route, Routes} from "react-router-dom";
import Header from './Components/Header';
import Footer from './Components/Footer';
import Home from './Home';
function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home/>} />
      </Routes>
    </div>
  );
}

export default App;
